config.script:
$.setPortCallback("input",onInput);

function onInput(ctx,s) {
    //$.output(s);

    try {
        var r = JSON.parse(s);
    } catch(e) {
        // fail silently on invalid JSON string
        return;
    }
    if(!r.Success)
        return;
    if(r.Data === null)
        return;

    var out = "";
    for(var i = 0; i < r.Data.length; ++i) {

      //  if(i === 0)
      //    out += "speed, battery, rank, user, timest, id\n" ;

        var row = r.Data[i];
        for(var col in row){
         if(row[col] === 'null')
           row[col] = 0

        }    

        var name_race = new String(row['value.user']);
        name_race = name_race.replace(/"/g,"");

        name_race = name_race.replace(/controller/g,"Monaco");
        name_race = name_race.replace(/Test2/g,"Toronto");
        name_race = name_race.replace(/AI Driver/g,"Texas");


        var mac = new String(row['value.id']);
        mac = mac.replace(/"/g,"");

        var timest = new String( row['_MessageGateway_TimeISO8601']);
        timest = timest.replace(/"/g,"");


            out += row['value.speed'] + ", " +row['value.battery'] +", "+row['value.rank'] +", "+name_race +", "+timest +", "+mac ;
        out += "\n";
    }
    $.output(out);

}
